import React, { Component } from "react";
import "./estilos.css";
import 'bootstrap/dist/css/bootstrap.min.css';

class Jogar extends Component {
    constructor(){
        super();
        this.numeroDaCarta ="";
    }
    
    handleIniciarJogo(){
        this.numeroDaCarta = Math.floor(Math.random() * 3);
        console.log(this.numeroDaCarta)
    }

    render() {
        return (
            <section>
                <button 
                onChange={this.handleIniciarJogo}
                >Jogar</button>
                <div>
                    <label>Placar</label>
                    <div>10</div>
                </div>
            </section>
        )
    }
}

export default Jogar
